import React from 'react';
import DatasetStats from './components/DatasetStats';
import GammaStatistics from './components/GammaStatistics';
import dataset from './dataset.json';

function App() {
  return (
    <div className="App">
      <DatasetStats />
      <GammaStatistics statistics = {dataset} />
    </div>
  );
}

export default App;
